import React, { Component } from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

class Routes extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route exact path='/' />
        </Switch>
      </BrowserRouter>
    );
  }
}

export default Router;
